import './App.css';

function App() {
  return (
    <div className="MainDiv">
      <p>TENUTA SAN TOMMASO</p>
      <div classname="Container">
        <button class="languageBtn">choose language</button>
        <button class="helpBtn">need help?</button>
      </div>
    </div>
  );
}

export default App;
